import React, {Component} from "react";

class AddUser extends Component {
    state={
        name:"",
        email:""
    };
    render(){
        const {name,email}=this.state;

        return (
            <div className="card">
                <h4 className="card-header">Add New User</h4>
                <div className="card-body">
                    <form>
                        <div className="form-group">
                            <label htmlFor="name">Name</label>
                            <input type="text" name="name" id="name" placeholder="Enter Name" className="form-control" value={name}/>
                        </div>
                        <div className="form-group mt-4">
                            <label htmlFor="email">E-Mail</label>
                            <input type="text" name="email" id="email" placeholder="Enter Email" className="form-control" value={email}/>
                        </div>
                        <button type="submit" className="btn btn-danger mt-4">Add New User</button>
                    </form>
                </div>
            </div>
        )
    }
}

export default AddUser;
